css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("startpage.com") {


* {
background-image: none !important;
box-shadow: none !important;
}

h3 a {
color: rgb(9, 82, 161) !important;
}

a#proxy_link.proxy,
a.proxy {
color: rgb(102, 0, 0) !important;
}

input {
border-radius: 0pt 0pt 0pt 0pt !important;
}

input#submit,
input#submit1 {
height: 0px !important;
border: none !important;
}

div#logo,
div#sponsored,
img[src*="logo"],
a.bookmark {
display: none !important;
}


}
